script: |
  super -f text -I q10105.spq | sort > q10105.out

inputs:
  - name: q10105.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 * - 57 * + - col2 * + - 16 NOT BETWEEN - col2 * + ( col2 ) / - col0 - + 63 * 36 AND - col1;
  - name: tab2

outputs:
  - name: q10105.out
    data: |
      46	51	23
      64	77	40
      75	67	58
